import React from 'react';
import s from './styles/Home.module.css';
const Home = () => {
  return (
    <div className={s.container}>
      <div className={s.wrapper1}>
        <image src="https://picsum.photos/200" />
      </div>
    </div>
  );
};

export default Home;
